import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Select from 'react-select';
import { useForm, Controller } from 'react-hook-form';
import UniversityCardList from './Neetcard';
import FundsTabs from './FundsTabs3';

export default function NeetStats() {
  const { control, handleSubmit, watch, reset } = useForm({
    defaultValues: {
      course: null,
      category: null,
      quota: null,
      maxRank: '',
    },
  });

  const [categories, setCategories] = useState([]);
  const [courses, setCourses] = useState([]);
  const [quotas, setQuotas] = useState([]);
  const [universities, setUniversities] = useState([]);
  const [showMostPopular, setShowMostPopular] = useState(false);
  const [errorMessage, setErrorMessage] = useState('');

  const selectedCourse = watch('course');
  const selectedCategory = watch('category');

  // Fetch filter options when component mounts
  useEffect(() => {
    fetchFilters();
  }, []);

  const fetchFilters = async () => {
    try {
      const response = await axios.get('http://localhost:4000/api/Neetfilters');
      setCategories([{ value: null, label: 'Select an option' }, ...response.data.city.map(cat => ({ value: cat, label: cat }))]);
      setCourses([{ value: null, label: 'Select an option' }, ...response.data.courses.map(course => ({ value: course, label: course }))]);
      setQuotas([{ value: null, label: 'Select an option' }, ...response.data.branches.map(quota => ({ value: quota, label: quota }))]);
    } catch (error) {
      console.error('Error fetching filters:', error);
    }
  };

  const fetchFilteredOptions = async (data) => {
    try {
      const queryParams = {};
      if (data.course) queryParams.course = data.course.value;
      if (data.category) queryParams.cat = data.category.value;
      if (data.quota) queryParams.quota = data.quota.value;

      const response = await axios.get('http://localhost:4000/api/Neetfilters', {
        params: queryParams,
      });

      // Update dependent filters
      setCategories([{ value: null, label: 'Select an option' }, ...response.data.city.map(cat => ({ value: cat, label: cat }))]);
      setCourses([{ value: null, label: 'Select an option' }, ...response.data.courses.map(course => ({ value: course, label: course }))]);
      setQuotas([{ value: null, label: 'Select an option' }, ...response.data.branches.map(quota => ({ value: quota, label: quota }))]);
    } catch (error) {
      console.error('Error fetching filtered options:', error);
    }
  };

  const handleSearch = async (data) => {
    if (!data.course && !data.category && !data.quota && !data.maxRank.trim()) {
      setErrorMessage('Please select at least one filter before searching.');
      return;
    }

    try {
      const response = await axios.post('http://localhost:4000/api/Neetpredict', {
        maxRank: data.maxRank,
        course: data.course?.value,
        category: data.category?.value,
        quota: data.quota?.value,
      });
      setUniversities(response.data);
      setShowMostPopular(true);
      setErrorMessage('');
    } catch (error) {
      console.error('Error fetching NEET predictions:', error);
    }
  };

  const handleClear = () => {
    reset(); // Reset all form fields
    setUniversities([]);
    setShowMostPopular(false);
    setErrorMessage('');
  };

  return (
    <>
      <form onSubmit={handleSubmit(handleSearch)}>
        <section className="stats_box py-10 grid place-items-center lg:grid-cols-5 grid-cols-2 gap-5 sm:w-9/12 w-11/12 mx-auto -mt-9 px-6">
          <div className="w-full">
            <Controller
              name="course"
              control={control}
              render={({ field }) => (
                <Select
                  {...field}
                  options={courses}
                  placeholder="Select Course"
                  classNamePrefix="react-select"
                />
              )}
            />
          </div>

          <div className="w-full">
            <Controller
              name="category"
              control={control}
              render={({ field }) => (
                <Select
                  {...field}
                  options={categories}
                  placeholder="Select Category"
                  classNamePrefix="react-select"
                  isDisabled={!selectedCourse} // Disable until course is selected
                />
              )}
            />
          </div>

          <div className="w-full">
            <Controller
              name="quota"
              control={control}
              render={({ field }) => (
                <Select
                  {...field}
                  options={quotas}
                  placeholder="Select Quota"
                  classNamePrefix="react-select"
                  isDisabled={!selectedCategory} // Disable until category is selected
                />
              )}
            />
          </div>

          <div className="w-full">
            <Controller
              name="maxRank"
              control={control}
              render={({ field }) => (
                <input
                  {...field}
                  type="text"
                  placeholder="Enter Rank"
                  className="md:text-[15px] text-[12px] font-bold p-2 border border-gray-300 rounded w-full"
                />
              )}
            />
          </div>

          <div className="w-full flex gap-2">
            <button
              type="submit"
              className="md:text-[15px] text-[12px] font-bold p-2 bg-orange-500 text-white rounded w-full"
            >
              Search
            </button>
            <button
              type="button"
              className="md:text-[15px] text-[12px] font-bold p-2 bg-gray-300 text-gray-600 rounded w-full"
              onClick={handleClear}
            >
              Clear Filters
            </button>
          </div>
        </section>
      </form>

      {errorMessage && <p className="text-red-500 text-center">{errorMessage}</p>}
      {showMostPopular && <FundsTabs universities={universities} />}
      <UniversityCardList universities={universities} />
    </>
  );
}
